    return (
        <>
        <Header/>
        <Hero/>
        </>
    )
}

function Header(){
    return (
        <>
        <nav className="flex">
            <a href="#" className="brand">brand</a>
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </nav>
        </>
    )
}

function Hero(){
    return (
        <>
       <h1>A</h1>
        </>
    )
}



export default App
